import React from "react";
import "./home.css";
import SingUp from './signup';
import LogIn from './login';
function Home() {
    
    
  return (
    <>
      <div className="Optionsflex">
        <div>
          <SingUp></SingUp>
        </div>
        <div>
          <LogIn></LogIn>
        </div>
      </div>
    </>
  );
}

export default Home;
